import './App.css';
import * as React from "react";
import { Admin, Resource } from 'react-admin';

import {
    TournamentList,
} from './pages/Tournaments';
import {
    SeasonList,
} from './pages/Seasons';
import {
    Provider,
} from './Provider';


const App = () => {
    return (
        <Admin dataProvider={Provider}>
            <Resource name="tournaments" list={TournamentList}/>
            <Resource name="seasons" list={SeasonList}/>
        </Admin>
    );
};

export default App;
